import React from "react";
import { NavLink } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <>
      <nav class="navbar">
        <div class="nav-container">
          <NavLink exact to="/" class="nav-logo" >AD</NavLink>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
